import Header from "../../components/header/Header";
import "./Routines.css";
import routines from "../../helpers/data";



function Routines() {
    return (
        <>
            <header><Header /></header>
            <body>
                <div className="container">
                    <a>3 DAYS</a>
                    <a>4 DAYS</a>
                    <a>5 DAYS</a>
                    <a>6 DAYS</a>
                </div>
            </body>
        </>
    );
}

export default Routines;
